import { Component } from 'react';


class Dataset extends Component {
    constructor(props) {
        super(props);
        this.state = {
            datasetOriginalJSON : this.props.datasetOriginalJSON
        };
    }


    render() {
        return (
            <div>
                <p>Prop Value: {JSON.stringify(this.props.datasetOriginalJSON)}</p>
                <p>State Value: {JSON.stringify(this.state.datasetOriginalJSON) }</p>
            </div>
        );
    }


}


export default Dataset
